import React, { useState, useEffect } from 'react';

const Carousel = ({ slides }) => {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [autoplay, setAutoplay] = useState(true);
  const [showMenu, setShowMenu] = useState(false);

  useEffect(() => {
    let intervalId;

    if (autoplay) {
      intervalId = setInterval(() => {
        setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
      }, 4000); // Adjust autoplay interval as needed
    }

    return () => clearInterval(intervalId);
  }, [autoplay, slides.length]);

  const nextSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide - 1 + slides.length) % slides.length);
  };

  return (
    <div className="w-full overflow-hidden">
      {/* Menu Bar */}
      <div className={`fixed left-0 top-0 h-96 w-64 bg-gray-800 flex items-center justify-center z-50 transition-transform duration-500 ${showMenu ? 'translate-x-0' : '-translate-x-full'}`}>
        <ul className="text-white">
          <li className="py-2 cursor-pointer" onClick={() => setShowMenu(false)}>Home</li>
          <li className="py-2 cursor-pointer" onClick={() => setShowMenu(false)}>About</li>
          <li className="py-2 cursor-pointer" onClick={() => setShowMenu(false)}>Services</li>
          <li className="py-2 cursor-pointer" onClick={() => setShowMenu(false)}>Contact</li>
        </ul>
      </div>

      {/* Carousel Content */}
      <div className="relative">
        <div
          className="carousel relative shadow-2xl bg-white w-full h-full"
          onMouseEnter={() => setAutoplay(false)}
          onMouseLeave={() => setAutoplay(true)}
        >
          {/* Carousel Images and Content */}
          {slides.map((slide, index) => (
            <div
              key={index}
              className={`relative w-full h-96 overflow-hidden ${index === currentSlide ? 'opacity-100' : 'opacity-0'}`}
              style={{ transition: 'opacity 1s ease' }}
            >
              <img
                src={slide.image}
                alt={`Slide ${index + 1}`}
                className="absolute inset-0 w-full h-full object-cover"
              />
              <div className="absolute inset-x-0 bottom-10 text-center z-20">
                <h1 className="text-3xl font-bold text-white">
                  {slide.title}
                </h1>
                <h6 className="text-lg mt-6 font-semibold text-white">
                  {slide.description}
                </h6>
                <div className='mt-6'>
                  <button className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded">
                    {slide.button1Text}
                  </button>
                  <button className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 ml-4 rounded">
                    {slide.button2Text}
                  </button>
                </div>
              </div>
            </div>
          ))}
          
          {/* Navigation Buttons */}
          <div className="absolute inset-x-0 bottom-0 flex justify-between items-center p-4">
            <div>
              <button
                className="w-8 h-8 bg-black bg-opacity-50 text-white rounded-full hover:bg-opacity-70"
                onClick={prevSlide}
              >
                &lt;
              </button>
              <button
                className="w-8 h-8 bg-black bg-opacity-50 text-white rounded-full hover:bg-opacity-70 ml-4"
                onClick={nextSlide}
              >
                &gt;
              </button>
            </div>
            <div className="flex space-x-2">
              {slides.map((_, index) => (
                <div
                  key={index}
                  className={`w-2 h-2 rounded-full bg-gray-500 hover:bg-gray-700 cursor-pointer ${
                    index === currentSlide ? 'bg-pink-500' : ''
                  }`}
                  onClick={() => setCurrentSlide(index)}
                ></div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* Menu Button */}
      <button
        className="fixed top-4 left-4 bg-gray-800 text-white rounded-full h-10 w-10 flex items-center justify-center z-50"
        onClick={() => setShowMenu((prev) => !prev)}
      >
        {showMenu ? 'X' : 'â˜°'}
      </button>
    </div>
  );
};

export default Carousel;
